import React from 'react'

function Header(){
    return (<><h1>Aaron App</h1>
    <p>Hello welcome to my world. I am Computer Science Engineering Student. I had alot of fun making this webpage. I like to spend most of my time watching different animes and webseries. I also like to play piano. I am also interested in coding. I have taken part in many hackathons.</p>
    </>
        )
}

export default Header;
